import React from "react";
import Col from "react-bootstrap/Col";
import Raw from "react-bootstrap/Row";
import Card from 'react-bootstrap/Card';

import './styles.css'

const Price = (props) => {
  return (
    <Raw>
      <a>Empresa</a>
      <Col xs={6} md={4}>
        $ 2,000.00
      </Col>
      <Col xs={6} md={4}>
        xs=6 md=4
      </Col>
      <Col xs={6} md={4}>
        xs=6 md=4
      </Col>
    </Raw>
  );
};

export default Price;
